import React from "react";

import Logo from "../../../components/Logo";
import "../../../style/Body.css";
import { FormGroup, Form, Button } from "react-bootstrap";

class Body extends React.Component {
  render() {
    return (
      <>
        <Logo />
        <FormGroup>
          <Form className="formBody">
            <Form.Group controlId="formBasicPhone">
              <Form.Label className="inputLable">Phone number</Form.Label>
              <Form.Control
                className="input"
                type="number"
                placeholder="401234567"
              />{" "}
              <select name="code" id="code">
                <option value="+34">Estonia</option>
                <option value="+44">Finland</option>
                <option value="+55">USA</option>
                <option value="+66">Sweden</option>
              </select>
            </Form.Group>

            <Form.Group controlId="formBasicPassword">
              <Form.Label className="inputLable">Password</Form.Label>
              <Form.Control className="input" type="password" />
            </Form.Group>

            <Button variant="primary" type="submit">
              Login
            </Button>
          </Form>
          <div>eloo</div>
        </FormGroup>
      </>
    );
  }
}
export default Body;
